  return (
    <>
      <div className="flex justify-between h-[50px] pr-2 pl-2 text-xs text-center items-end">
        <div>
          github: <a href="https://github.com/henry-shih4"></a>henry-shih4
        </div>
        <div>Powered by OpenWeatherApp and Geoapify</div>
      </div>
    </>
  );
}
